import React, { Component } from 'react';
import CardList from './CardList';
import SearchBox from './SearchBox';
import { Robots } from './Robots.js';

const state = {
	Robots: Robots,
	searchfield:''
}

class App extends Component {
	constructor () {
		super()
		this.state = {
				Robots: Robots,
					searchfield:''
		}
	}
	render () {
		return (
			<div className='tc'>
				<h1>Robofriends</h1>
				<SearchBox />
				<CardList Robots={Robots}/>
			</div>
		);
	}
}

export default App;
